import React, { useState } from "react";
import { Link } from 'react-router-dom';
import "./Navbar.css";

export default function Navbar() {

  const [click, setClick] = useState(false);

  const handleClick = () => setClick(!click);

  const closePhoneMenu = () => setClick(false);




  return (
   <>
      <nav className="navbar">
        <div className="navbar-container">
          <Link to="/"Home className="navbar-logo" onClick={closePhoneMenu}>
            Skywalker
          </Link>
          <div className="menu-icons" onClick={handleClick}>
            <i className={click ? "fas fa-times" : "fas fa-bars"} />
          </div>
          <ul className={click ? "nav-menu active" : "nav-menu"}>
            <li className="nav-item">
              <Link to="/" className="nav-links" onClick={closePhoneMenu}>
                Home
              </Link>
            </li>
            <li className="nav-item">
              <Link to="/resume" className="nav-links" onClick={closePhoneMenu}>
                Resume
              </Link>
            </li>
            <li className="nav-item">
              <Link to="/projects" className="nav-links" onClick={closePhoneMenu}>
                Projects
              </Link>
            </li>
            <li className="nav-item">
              <Link to="/contact" className="nav-links" onClick={closePhoneMenu}>
                Contact
              </Link>
            </li>
          </ul>
        </div>
      </nav>

  </>
  )
}


































